class Solution:
    def findSubstring(self, s, words):
        """
        :type s: str
        :type words: List[str]
        :rtype: List[int]
        """
        if s == "" or len(words) == 0:
            return []

        window_size = len(words[0])

        index = {}
        for word in words:
            if word not in index:
                index[word] = 0
            index[word] += 1
        res = []
        for start in range(len(s) - window_size + 1):
            word = s[start : (start + window_size)]
            if word in index and start + window_size * len(words) <= len(s):
                found = {}
                for i in range(len(words)):
                    idx = start + i * window_size
                    candidate = s[idx : (idx + window_size)]
                    # print(candidate)
                    if candidate in index:
                        if candidate not in found:
                            found[candidate] = 0
                        found[candidate] += 1
                        if found[candidate] > index[candidate]:
                            break
                    else:
                        break
                if index == found:
                    # print(index, found)
                    res.append(start)

        return res


